      call assert_equals( expected_lake_types, lake_types,nlat_lake,nlon_lake)
      call assert_equals( expected_lake_volumes, lake_volumes,size(expected_lake_volumes))
      call assert_equals( diagnostic_lake_volumes, expected_diagnostic_lake_volumes,nlat_lake,nlon_lake)
      call assert_equals( expected_lake_fractions, lake_fractions,nlat_surface,nlon_surface)
      call assert_equals( expected_number_lake_cells, lake_model_prognostics.lake_cell_count,nlat_surface,nlon_surface)
