      lake_types(:,:) = 0
      do i = 1,nlat_lake
        do j = 1,nlon_lake
          lake_number = lake_model_prognostics_out%lake_numbers(i,j)
          if (lake_number > 0) then
            working_lake_ptr = lake_model_prognostics_out%lakes(lake_number)
            lake_type = working_lake_ptr%lake_pointer%lake_type
              if (lake_type == filling_lake_type) then
                lake_types(i,j) = 1
              else if (lake_type == overflowing_lake_type) then
                lake_types(i,j) = 2
              else if (lake_type == subsumed_lake_type) then
                lake_types(i,j) = 3
              else
                lake_types(i,j) = 4
              end if
          end if
        end do
      end do
      allocate(lake_volumes(size(lake_model_prognostics_out%lakes))
      do i = 1,size(lake_volumes)
        working_lake_ptr = lake_prognostics_out%lakes(i)
        lake_volumes(i) = working_lake_ptr%lake_pointer%lake_volume
      end do
      diagnostic_lake_volumes => calculate_diagnostic_lake_volumes_field(lake_model_parameters, &
                                                                         lake_model_prognostics)
      call assert_equals( expected_river_inflow, river_fields.river_inflow,nlat_hd,nlon_hd)
      call assert_equals(expected_water_to_ocean,
                       river_fields.water_to_ocean,nlat_hd,nlon_hd,0.00001)
      call assert_equals( expected_water_to_hd, lake_model_prognostics.water_to_hd,nlat_hd,nlon_hd)
      call assert_equals( expected_lake_numbers, lake_model_prognostics.lake_numbers,nlat_lake,nlon_lake)
      call assert_equals( expected_lake_types, lake_types,nlat_lake,nlon_lake)
      call assert_equals( expected_lake_volumes, lake_volumes,size(expected_lake_volumes))
      call assert_equals( diagnostic_lake_volumes, expected_diagnostic_lake_volumes,nlat_lake,nlon_lake)
      call assert_equals(expected_lake_fractions,lake_fractions,nlat_surface,nlon_surface,0.00001))
      call assert_equals( expected_number_lake_cells, lake_model_prognostics.lake_cell_count,nlat_surface,nlon_surface)
      call assert_equals( expected_number_fine_grid_cells, lake_model_parameters.number_fine_grid_cells,nlat_surface,nlon_surface)
      !@test expected_true_lake_depths, lake_model_parameters.true_lake_depths
end subroutine testLakeModel17

